import React from 'react';

const AdminDashboard = () => {
  return (
    <div className="container">
      <h1>Admin Dashboard</h1>
      <p>Welcome, Admin!</p>
      <ul>
        <li>Review and approve car submissions</li>
        <li>Manage users</li>
        <li>View system statistics</li>
      </ul>
    </div>
  );
};

export default AdminDashboard;
